import { CoursePartBase} from "../types";
import Part from "./Part";

const Content = ({courseParts}: {courseParts: Array<CoursePartBase >}) => {
    return(
        <>
        {
            courseParts.map(c => (
                <div key={c.name}>
                    <p><b>{c.name} {c.exerciseCount}</b></p>
                    <Part course={c}/>
                </div>
            ))
        }
        </>
    )
}

export default Content;
